package com.wh.entity;

import java.util.Date;

/**
 * @Description 
 * @param
 * @return
 * @date 2015年11月4日上午10:21:34
 * @author 郑爽
 */
public class UserRoleLink {
	
	private String role_user_id;//主键id
	private String role_id;//角色id
	private String user_id;//用户id
	private String account;//账号
	private String creator;//创建人
	private Date create_time;//创建时间
	private Date del_time;//删除时间
	
	
	
	public UserRoleLink() {
		super();
		// TODO Auto-generated constructor stub
	}



	public UserRoleLink(String role_user_id, String role_id, String user_id, String account, String creator,
			Date create_time, Date del_time) {
		super();
		this.role_user_id = role_user_id;
		this.role_id = role_id;
		this.user_id = user_id;
		this.account = account;
		this.creator = creator;
		this.create_time = create_time;
		this.del_time = del_time;
	}



	public String getRole_user_id() {
		return role_user_id;
	}



	public void setRole_user_id(String role_user_id) {
		this.role_user_id = role_user_id;
	}



	public String getRole_id() {
		return role_id;
	}



	public void setRole_id(String role_id) {
		this.role_id = role_id;
	}



	public String getUser_id() {
		return user_id;
	}



	public void setUser_id(String user_id) {
		this.user_id = user_id;
	}



	public String getAccount() {
		return account;
	}



	public void setAccount(String account) {
		this.account = account;
	}



	public String getCreator() {
		return creator;
	}



	public void setCreator(String creator) {
		this.creator = creator;
	}



	public Date getCreate_time() {
		return create_time;
	}



	public void setCreate_time(Date create_time) {
		this.create_time = create_time;
	}



	public Date getDel_time() {
		return del_time;
	}



	public void setDel_time(Date del_time) {
		this.del_time = del_time;
	}



	@Override
	public String toString() {
		return "UserRoleLink [role_user_id=" + role_user_id + ", role_id=" + role_id + ", user_id=" + user_id
				+ ", account=" + account + ", creator=" + creator + ", create_time=" + create_time + ", del_time="
				+ del_time + "]";
	}
	
	
}
